title: Mutual recursion in a chain of inheritance
description: >
  The defect manifests in the form of call chain cycles.
  The following cycles are present here:
  o12157.m1 -> o12157.m5 -> o12157.m2 -> o12144.m28 -> o12157.m8 -> o12144.m28
  o12157.m8 -> o12144.m28 -> o12157.m8
  o12144.m30 -> o12157.m4 -> o12144.m28 -> o12157.m8 -> o12144.m28
  o12157.m6 -> o12157.m0 -> o12144.m30 -> o12157.m4 -> o12144.m28 -> o12157.m8 -> o12144.m28
  o12144.m28 -> o12157.m8 -> o12144.m28
  o12157.m5 -> o12157.m2 -> o12144.m28 -> o12157.m8 -> o12144.m28
  o12157.m4 -> o12144.m28 -> o12157.m8 -> o12144.m28
  o12157.m0 -> o12144.m30 -> o12157.m4 -> o12144.m28 -> o12157.m8 -> o12144.m28
  o12144.m36 -> o12157.m6 -> o12157.m0 -> o12144.m30 -> o12157.m4 -> o12144.m28 -> o12157.m8 -> o12144.m28
  o12157.m2 -> o12144.m28 -> o12157.m8 -> o12144.m28

features:
  - inheritance
  - overriding
  - method
  - polymorphism

